import React, { Component } from 'react';
import { Provider } from 'react-redux';
import store from '../store/store';

const page = (Page) => {
    return (
        class PageWrapper extends Component {
            render() {
                return (
                    <Provider store={store}>
                        <PageWrapper />
                    </Provider>
                )
            }
        }
    )
}

export default page;
